import React, { useEffect, useState } from "react";
import Result from "../components/Result";
function MyRaces() {
    const [myResults, setMyResults] = useState([])
    const [myRaces, setMyRaces] = useState([])

    const fetchMyRaces = () => {
        let restURL = "http://localhost:8081/race/rest/races/myRaces";
        fetch(restURL, {
            method: "GET",
            credentials: 'include',
            headers: {
                'Content-Type': 'application/json',
            }
        })
            .then(response => {
                return response.json()
            })
            .then(data => {
                setMyRaces(data)
            })
    }
    const fetchResults = () => {
        let restURL = "http://localhost:8081/race/rest/results/myResults/";
        fetch(restURL, {
            method: "GET",
            credentials: 'include',
            headers: {
                'Content-Type': 'application/json',
            }
        })
            .then(response => {
                return response.json()
            })
            .then(data => {
                setMyResults(data)
            })
    }
    useEffect(() => {
        //fetchMyRaces()
        fetchResults()
    }, [])

    let resList = [];
    myResults.forEach(res => {
        resList.push(
        <Result key={res.id} data={res}/>
      )
    });
    return (
        <div className="Page">
            <div className="RegisteredFor">
                {}
            </div>
            <div className="MyResults">
                {}
            </div>
        </div>
    );
}

export default MyRaces;
